- input: 'TEXT,F3A,,"The McCaul for Congress committee filed a 48 Hour notice on 10/30/06
    (FEC ID-254661).  The notice reported a $2200 contribution from Ron Henriksen.  It
    turns out that Mr. Henriksen and his wife Sheri had intended for this to be a
    joint contribution.  Unfortunately, we did not receive notification about their
    intention until after the notice was filed.  Our FEC Report will reflect a joint
    contribution from this couple: $1100 from Ron Henriksen and $1100 from Sheri Henriksen.            The
    FECfile software does not permit the user to use the ''transaction split'' function
    on a debt payment. We have manually entered memo entries that refer back to the
    $603.51 payment to Continental Airlines Mastercard on 10/19/06 (please see additional
    memo text)."'
